import React from "react";
import { Link } from 'react-router-dom';
import Dropdown from 'react-bootstrap/Dropdown'

function Nav() {
  return (
    <div class="navbar">
      <a href="/">OUR STORY</a>
      <div class="dropdown">
        <button class="dropbtn">LOGISTICS 
          <i class="fa fa-caret-down"></i>
        </button>
        <div class="dropdown-content">
          <a href="#">TRAVEL</a>
          <a href="#">LODGING</a>
          <a href="#">ADVENTURE</a>
        </div>
        <a href="/registry">REGISTRY</a>
        <a href="/rsvp">rsvp</a>
      </div> 
    </div>
  );
}

export default Nav;
